import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element to be visible
    await page.waitForSelector('.cart');

    // Click on the cart to view items
    await page.click('.cart');

    // Wait for the cart items to load
    await page.waitForSelector('.cart-item');

    // Update the quantity of the first item in the cart
    await page.waitForSelector('.cart-item-quantity');
    await page.selectOption('.cart-item-quantity select', '2'); // Change quantity to 2

    // Take a screenshot after updating the quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_quantity_updated.png'));

    // Verify the quantity was updated
    const quantityText = await page.textContent('.cart-item-quantity .quantity');
    const quantityUpdated = quantityText === '2';

    return {
      success: true,
      action: "Updated cart item quantity to 2",
      extractedData: { quantityUpdated },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
